import React from "react";
import Button from "./Button.jsx";

class LoginPage extends React.Component {
  
  constructor(props) {
    super(props);
    this.login = this.login.bind(this);
  };

  login() {
    console.log("i am in pain")
  };

  render() {
    return (
      <div className="loginPageContainer">
        <div className="logoText">OH-Helper</div>
        <div className="loginWindowContainer">
          <div className="loginWindow">
            <p className="loginHeader">Login/Create Account</p>
            <div className="lineBreak"></div>
            <p className="emailInputHeader">Email:</p>
            <input
              type="email"
              name="email"
              id="email"
              className="emailInput"
              placeholder="Email..."
            />
            <p className="passwordInputHeader">Password:</p>
            <input
              type="password"
              name="password"
              id="password"
              className="passwordInput"
              placeholder="Password..."
            />
            <Button
              active={true}
              onclick={() => this.login()}
              text="Login"
              buttonType="loginButton"
            ></Button>
            <br />
            <Button
              active={true}
              onclick={() => this.login()}
              text="Create Account"
              buttonType="createButton"
            ></Button>
          </div>
        </div>
      </div>
    );
  }
}

export default LoginPage;
